import React from 'react'

const App = () => {
// This function returns JSX code, allowing us to construct HTML components
// using JavaScript XML.
  return (
  // Everything returned must be within a single element.

    // <div className="App"></div>
    <div>
    {/* Empty elements are called fragments. */}
    {/* JSX uses "className" instead of "class". */}
    {/* JSX comments have to be written in curly braces, and cannot use double
    slashes. */}
    {/* All JavaScript written in JSX must be within curly braces. */}
      <h1>Taylor Moon Tattoos</h1>
    </div>
  );
}

export default App;
